First introduced in Synapse v1.45.0 async def user_may_send_3pid_invite( inviter: str, medium: str, address: str, room_id: str,
) -> bool Called when processing an invitation using a third-party identifier (also called a 3PID, e.g. an email address or a phone number). The module must return a bool indicating whether the inviter can invite the invitee to the given room. The inviter is represented by their Matrix user ID (e.g. @alice:example.com), and the invitee is represented by its medium (e.g. "email") and its address (e.g. alice@example.com). See the Matrix specification for more information regarding third-party identifiers. For example, a call to this callback to send an invitation to the email address alice@example.com would look like this: await user_may_send_3pid_invite( "@bob:example.com", # The inviter's user ID "email", # The medium of the 3PID to invite "alice@example.com", # The address of the 3PID to invite "!some_room:example.com", # The ID of the room to send the invite into
) Note : If the third-party identifier is already associated with a matrix user ID, user_may_invite will be used instead. If multiple modules implement this callback, they will be considered in order. If a callback returns True, Synapse falls through to the next one. The value of the first callback that does not return True will be used. If this happens, Synapse will not call any of the subsequent implementations of this callback.

