For maximum flexibility, you need to configure an external server such as nginx, Apache or HAProxy to serve the https://<server_name>/.well-known/matrix/server file. Setting up such a server is out of the scope of this documentation, but note that it is often possible to configure your reverse proxy for this. The URL https://<server_name>/.well-known/matrix/server should be configured return a JSON structure containing the key m.server like this: { "m.server": "<synapse.server.name>[:<yourport>]"
} In our example (where we want federation traffic to be routed to https://synapse.example.com, on port 443), this would mean that https://example.com/.well-known/matrix/server should return: { "m.server": "synapse.example.com:443"
} Note, specifying a port is optional. If no port is specified, then it defaults to 8448.
